const EVENTS=
[
  {
    id: 1,
    name: "Event 1",
    date: "2021-01-01",
    location: "Location 1",
    description: "Description 1",
  },
  {
    id: 2,
    name: "Event 2",
    date: "2021-01-02",
    location: "Location 2",
    description: "Description 2",
  },
  {
    id: 3,
    name: "Event 3",
    date: "2021-01-03",
    location: "Location 3",
    description: "Description 3",
  },
];

export default function EventsPage() {
  return <>
    <h1>Events</h1>
    <ul>
      {EVENTS.map(event => (
        <li key={event.id}>
          <a href={`/events/${event.id}`}>{event.name}</a>
        </li>
      ))}
    </ul>
  </>
}
